import React from 'react'
import Navbar from './Navbar'
import image from '../assets/download (1).jpeg';
import '../App.css';

function Home() {
  return (
      <>
      <Navbar />
      <div className='image'>
          <img src={image} className='home-image'></img>
          </div>
      </>
  )
}

export default Home
